// Funcion para renderizar todos los iconos disponibles en la libreria a traves del json generado por IcoMoon

window.addEventListener('DOMContentLoaded', () => {

    const renderIcons = (data, wrapper = '') => {

        if (data) {
            let arrayIcons = data.selection;
            let prefixIcon = data.preferences.fontPref.prefix;
            let iconsPreviewWrapper = document.querySelector(`${wrapper}`)

            if (iconsPreviewWrapper) {
                for (const arrayIcon of arrayIcons) {
                    let iconName = arrayIcon.name;

                    let iconPreviewBox = `
                        <a class="iconPreview-item" data-icon_target='${iconName}' href="javascript:void(0);">
                            <i class="icon ${prefixIcon}${iconName}"></i>
                            <span class="iconPreview-name">${iconName}</span>
                        </a>
                    `;

                    iconsPreviewWrapper.innerHTML += iconPreviewBox;
                }
            }
        }
    }

    renderIcons(dataIcons, '.iconsPreview-list.racoon-icons')
});

